import React from "react";
import Landing from "../components/Landing";
import CaseStudyCard from "../components/CaseStudyCard";
import workData from "../assets/workData.json";

const Home = () => {
  return (
    <div className="Page" id="home">
      <Landing />
      <h1 id="work">Work</h1>
      <div className="caseStudies">
        {workData.map((study) => (
          <CaseStudyCard
            img={study.img}
            name={study.name}
            caseStudy={study.caseStudy}
            description={study.description}
            number={study.num}
            able={study.able}
          />
        ))}

        <div className="card cardNav disable">
          {/* <p>womp womp</p> */}
          <div className="caseCard">
            <div className={"container 2"}>
              <img
                className="cardImage"
                src={process.env.PUBLIC_URL + "/images/warp_home_banner.png"}
              ></img>
            </div>

            <div className="cardBottom">
              <h1 className="largeCardText">Work in Progress</h1>
              <h3 className="smallCardText">work work work</h3>
            </div>
          </div>
        </div>
      </div>
      {/* <CaseStudyCard name={"Case Study #1"} caseStudy={"warpHome"} description={"this is the warp home"}/> */}
    </div>
  );
};

export default Home;

